import React, {Component} from "react";

class Oemrecord extends Component{
    constructor(props){
        super(props);
        this.state = {
            isLoaded:false,
            items:[]
        }
    }

    componentDidMount(){
        fetch('http://13.233.237.220:8091/getOemdetails').
        then(res=>res.json()).
        then(json => {
            this.setState({
                isLoaded:true,
                items:json
            })
        });
    }


    render(){
        var { isLoaded, items } = this.state;
        if(!isLoaded){
            return <div>Loading ...</div>
        }else{
            return (
            <div>
                Data 
                {items.map(item=>(
                    <li key={item.oem_id}>{item.oem_name} | {item.oem_type}</li>
                ))};
            </div>
        )
}
}
}

export default Oemrecord;
